import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Map, TileLayer, FeatureGroup } from 'react-leaflet';
import L from 'leaflet';
import { EditControl } from "react-leaflet-draw"
import Control from "react-leaflet-control";

import 'leaflet/dist/leaflet.css';
import 'leaflet-draw/dist/leaflet.draw.css';

// our components
import ShSideBar from './shSideBar';
import {
  postPointLayer, postPolygonLayer, getPolygonLayer
} from '../actions/layerActions';
import {
  CREATE_LAYERS_SUCCESS,
} from '../actions/types';

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.0.0/images/marker-icon.png',
  iconUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.0.0/images/marker-icon.png',
  shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.0.0/images/marker-shadow.png',
});

class MapView extends Component {
  constructor(props) {
    super(props);
    this.attributeCropType = 1;
    this.state = {
      currentLocation: { lat: 8.7903, lng: 11.4773 },
      zoom: 13,
      info: "Create and add information about a field",
    }
  }


  /** > Calculate AREA from an array of LatLng points ------------------------------------------------------------- */
  _shapeArea = (latlngs) => {
    let a = L.GeometryUtil.geodesicArea(latlngs)
    return (L.GeometryUtil.readableArea(a, true, 10))
  }

  handleSelectChange = (event) => {
    this.attributeCropType = event.target.value;
  }

  _onEdited = (e) => {

    let numEdited = 0;
    e.layers.eachLayer((layer) => {
      numEdited += 1;
    });
    console.log(`_onEdited: edited ${numEdited} layers`, e);

    this._onChange();
  }

  _onCreated = (e) => {
    function addAttributes(d, e) {
      console.log(d)
      let properties = { attributeArea: e.state.attributeArea, attributeCropType: e.attributeCropType, week1_ndvi: 0.00, week2_ndvi: 0.00, week3_ndvi: 0.00, week4_ndvi: 0.00, week1_ndwi: 0.00, week2_ndwi: 0.00, week3_ndwi: 0.00, week4_ndwi: 0.00,};
      d.properties = properties;
      if (d.geometry.type === "Polygon") {
        e.props.postPolygonLayer(d)
      } else if (d.geometry.type === "Point") {
        // this isn't accounting for circles
        e.props.postPointLayer(d)
      }
    }
    // console.log(this)
    let type = e.layerType;
    let layer = e.layer;
    if (type === 'marker') {
      // Do marker specific actions
      console.log("_onCreated: marker created", e);
    }
    else {
      console.log("_onCreated: something else created:", type, e);
    }
    let geo_layer = e.layer.toGeoJSON()

    let area = L.GeometryUtil.geodesicArea(e.layer.getLatLngs()[0]);

    this.setState({
      info: "Add information about field Here",
      attributeArea: area,
    })

    addAttributes(geo_layer, this);
    // // Do whatever else you need to. (save to db; etc)

    this._onChange();
  }

  _onDeleted = (e) => {

    let numDeleted = 0;
    e.layers.eachLayer((layer) => {
      numDeleted += 1;
    });
    console.log(`onDeleted: removed ${numDeleted} layers`, e);

    this._onChange();
  }
  _onMounted = (drawControl) => {
    console.log('_onMounted', drawControl);
  }

  _onEditStart = (e) => {
    console.log('_onEditStart', e);
  }

  _onEditStop = (e) => {
    console.log('_onEditStop', e);
  }

  _onDeleteStart = (e) => {
    console.log('_onDeleteStart', e);
  }

  _onDeleteStop = (e) => {
    console.log('_onDeleteStop', e);
  }

  _editableFG = null

  // highlightSelection(e, feature) {
  //   var layer = e.target;
  //   layer.setStyle({
  //     weight: 2,
  //     opacity: 0.5,
  //     color: "#666",
  //     fillOpacity: 0.7,
  //   });
  // }

  _onFeatureGroupReady = async (reactFGref) => {
    let baron = await this.props.getPolygonLayer();
    // populate the leaflet FeatureGroup with the geoJson layers

    let leafletGeoJSON = new L.GeoJSON(baron);

    console.log("Desire")

    let leafletFG = reactFGref.leafletElement;

    leafletGeoJSON.eachLayer((layer) => {
      let feature = layer.feature;
      layer.bindPopup("ID: " + feature.id + '<br/>Area: ' + feature.properties.attributeArea + '<br/>CropType: ' + feature.properties.attributeCropType + "<br/>" )
      leafletFG.addLayer(layer);
    });

    // store the ref for future access to content
    this._editableFG = reactFGref;
  }

  _onChange = () => {
    // this._editableFG contains the edited geometry, which can be manipulated through the leaflet API

    const { onChange } = this.props;

    if (!this._editableFG || !onChange) {
      return;
    }

    const geojsonData = this._editableFG.leafletElement.toGeoJSON();
    onChange(geojsonData);
  }

  render() {
    const { currentLocation, zoom } = this.state;
    let info = "Create and add information about a field";
    let area;
    if (this.state.info !== info) {
      info = this.state.info;
      area = this.state.attributeArea;
    }
    return (
      <React.Fragment>
        <ShSideBar />
        <Map
          zoomControl={false}
          center={currentLocation}
          zoom={zoom}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors"
          />
          <FeatureGroup ref={(reactFGref) => { this._onFeatureGroupReady(reactFGref); }}>
            <EditControl
              position='topright'
              onEdited={this._onEdited}
              onCreated={this._onCreated}
              onDeleted={this._onDeleted}
              onMounted={this._onMounted}
              onEditStart={this._onEditStart}
              onEditStop={this._onEditStop}
              onDeleteStart={this._onDeleteStart}
              onDeleteStop={this._onDeleteStop}
              draw={{
                rectangle: false,
                circle: false,
                marker: false,
                circlemarker: false,
                polyline: false,
              }}
            />
            <Control ref="info" className="info" position="topright">
              <div>{info}</div><br />

              <div>Area: <span>{area}</span></div><br />

              <select id="select" onClick={this.handleSelectChange}>
                <option value="1">Maize</option>
                <option value="2">Beans</option>
                <option value="3">Sorghum</option>
              </select><br />
            </Control>
          </FeatureGroup> 
        </Map>
      </React.Fragment>
    );
  }
}

